REPLACE INTO `messages` (`id`, `user_id`, `ticket_id`, `message`, `created_at`, `updated_at`) VALUES
	(1, 1, 1, 'The client is currently overseas, and we are awaiting their return.', '2024-03-11 11:14:22', '2024-03-11 11:14:22'),
	(2, 1, 12, 'It has been 15 days, and we still haven\'t received an update from Alpha.', '2024-03-12 14:10:48', '2024-03-12 14:10:48'),
	(3, 1, 14, 'Job reference: WO-101063', '2024-03-12 14:20:30', '2024-03-12 14:20:30'),
	(4, 1, 14, 'Sent an followup email', '2024-03-12 14:21:19', '2024-03-12 14:21:19'),
	(5, 1, 14, 'Sent an followup email - 13/03/2024', '2024-03-12 14:21:34', '2024-03-12 14:21:34'),
	(6, 1, 15, 'The system was replaced between March 4 and 8 and is now operational.', '2024-03-12 14:28:57', '2024-03-12 14:28:57'),
	(7, 1, 16, 'Sent a followup email to Liegh the installer ', '2024-03-12 14:42:22', '2024-03-12 14:42:22'),
	(8, 1, 16, 'Leigh mentioned that he can do the job this coming Friday, March 15th.', '2024-03-12 15:09:30', '2024-03-12 15:09:30'),
	(9, 1, 17, 'The Saj team returned on February 15th and confirmed that everything was okay.', '2024-03-12 16:07:46', '2024-03-12 16:07:46'),
	(10, 1, 18, 'The system was successfully replaced, but further action is required.\r\n\r\nEmail from client: Your company needs to send an authorized technician to ensure all the conduit is glued correctly to meet electrical standards ASAP-3000.', '2024-03-12 16:10:51', '2024-03-12 16:10:51'),
	(11, 1, 19, 'Colin (contractor) at admin@chuxelectrical.com replaced the cable and confirmed that the system is functioning normally without any issues after the replacement.\r\n\r\nConfirmed on March 12, 2024.', '2024-03-12 16:15:07', '2024-03-12 16:15:07'),
	(12, 1, 20, 'The replacement inverter was delivered on March 6, and Fahad from Alpha was informed.', '2024-03-12 16:23:55', '2024-03-12 16:23:55'),
	(13, 1, 20, 'Five days later, with no update from Alpha, a follow-up email was sent.', '2024-03-12 16:24:11', '2024-03-12 16:24:11'),
	(14, 1, 9, 'Thank you for contacting Fronius Australia.\r\n \r\nWe would recommend the customer reloads the country setup to AUA to apply better grid voltage settings:\r\n \r\n1.   On the inverter screen press Escape button (third button from the left) 6 times to bring up \'00000\'\r\n2.   Enter the code \'73887\'. Use the first 2 buttons to change the number, 4th button to save the number, then 4th button to save the code when complete. After the code starts flashing, press the 4th button again to enter the next menu.\r\n\r\n3.   Select the country setup as AUA  AUS Region A 2020 (4th button to save)\r\n4.   The inverter will load and then reboot and start up after a few minutes.\r\n \r\nKind Regards,\r\n\r\nChris Rogash\r\nNational Technical Support Engineer\r\nCEC Accredited Designer\r\nSolar Energy\r\n\r\nFronius Australia Pty Ltd\r\n90-92 Lambeck Drive, Tullamarine VIC 3043, Australia', '2024-03-12 16:36:24', '2024-03-12 16:36:24'),
	(15, 1, 22, 'Warranty claim submitted 12/03/24.', '2024-03-12 16:49:09', '2024-03-12 16:49:09'),
	(16, 1, 1, 'Colin Norris (0490 503 073) - Completed the job and confirmed the system to be working without any fault.', '2024-03-12 16:50:15', '2024-03-12 16:50:15'),
	(17, 1, 23, 'Saj returned to complete the backup circuit and inspect the system. The system is now charging and functioning properly.\r\n\r\nInitially, it seemed there was an issue with the firmware, but it was resolved by updating the firmware.\r\n\r\nThe case is now closed.', '2024-03-12 17:07:58', '2024-03-12 17:07:58'),
	(18, 1, 11, 'Grant will submit the report today.', '2024-03-13 14:38:15', '2024-03-13 14:38:15'),
	(19, 1, 3, 'Prepaid $285 today.', '2024-03-13 14:40:29', '2024-03-13 14:40:29'),
	(20, 1, 4, 'System is confirmed to be working fine.', '2024-03-13 15:03:38', '2024-03-13 15:03:38'),
	(21, 1, 6, 'The system is charging from the grid even though the settings are disabled.\r\n\r\nAn email has been sent to the manufacturer.', '2024-03-13 15:16:38', '2024-03-13 15:16:38'),
	(22, 1, 24, 'Client just reported that the breaker keeps tripping.\r\n\r\nCurrently switched off.', '2024-03-17 17:38:30', '2024-03-17 17:38:30'),
	(23, 1, 3, 'Grant confirmed to install the replacement (18/03/24) in fact he is already in the clients place.', '2024-03-17 17:46:50', '2024-03-17 17:46:50'),
	(24, 1, 11, 'Warranty Claim submitted - 18/03/24', '2024-03-17 17:47:50', '2024-03-17 17:47:50'),
	(25, 1, 3, 'Inverter replaced by Grant 18th March', '2024-03-18 16:00:38', '2024-03-18 16:00:38'),
	(26, 1, 5, 'Fahad(Alpha) was informed and asked to arrange installer (18/03)', '2024-03-18 16:10:09', '2024-03-18 16:10:09'),
	(27, 1, 6, 'Firmware has been updated and the system looks to be working correctly.', '2024-03-18 16:10:40', '2024-03-18 16:10:40'),
	(28, 1, 6, 'unfornately, issue persists.', '2024-03-18 16:14:54', '2024-03-18 16:14:54'),
	(29, 1, 7, 'System is tripping the main house as client reported.', '2024-03-18 16:15:54', '2024-03-18 16:15:54'),
	(30, 1, 7, 'Issue has been raised to Adam.', '2024-03-18 16:16:05', '2024-03-18 16:16:05'),
	(31, 1, 14, 'We are working on scheduling our attendance to your site as soon as possible and your query has been raised with our Field Service Team who will be in contact in the next 2 days.\r\n\r\nIf you do not hear from us within 2 days or wish to speak to a member of our Field Service Team regarding your case please contact us on 02 9000 7676 and select Option 4 for Field Service Team', '2024-03-18 18:49:10', '2024-03-18 18:49:10'),
	(32, 1, 13, 'Sent followup email to Vicky--\r\n\r\nIt was suggested to have Marcus do the changeover but no response or update from them yet.', '2024-03-19 16:33:27', '2024-03-19 16:33:27'),
	(33, 1, 13, 'Marcus said they would be at an hourly rate as they are not sure what\'s wrong. It is supposed that their price will be high. So we will look for an out sourcing installer to do the replacement.\r\n\r\nI have asked our Field Service team to take high priority on it and they will keep you posted.', '2024-03-20 11:33:21', '2024-03-20 11:33:21'),
	(34, 1, 2, 'sent a followup email.', '2024-03-20 14:11:53', '2024-03-20 14:11:53'),
	(35, 1, 3, 'Completed', '2024-03-20 14:12:21', '2024-03-20 14:12:21'),
	(36, 1, 6, 'Alpha will send their own technician to inspect the system.\r\n\r\nClient has been made aware.', '2024-03-20 14:13:07', '2024-03-20 14:13:07'),
	(37, 1, 9, 'There was no response from the client for more than a week. Considering the case closed.', '2024-03-20 14:17:34', '2024-03-20 14:17:34'),
	(38, 1, 10, 'Kal went back and rectified the CT issue.', '2024-03-21 14:11:17', '2024-03-21 14:11:17'),
	(39, 1, 10, 'System has 1.6kW constant load which doesnt make sense.\r\n\r\nAn email has been sent to sofar for futher investigation.', '2024-03-21 14:51:14', '2024-03-21 14:51:14'),
	(40, 1, 2, 'tracking number "SMA0000537" on the following website: https://www.airroad.com.au/quick-track/', '2024-03-21 15:58:06', '2024-03-21 15:58:06'),
	(41, 1, 11, 'For tracking, enter the following tracking number "SMA0000536" on the following website: https://www.airroad.com.au/quick-track/', '2024-03-24 11:47:10', '2024-03-24 11:47:10'),
	(42, 1, 11, 'Approved.', '2024-03-24 11:47:20', '2024-03-24 11:47:20'),
	(43, 1, 16, 'Inverter and battery has been replaced and it\'s confirmed by Leigh that the system is working correctly without any issues.\r\n\r\nA collection has been arramged as well.', '2024-03-24 11:48:21', '2024-03-24 11:48:21'),
	(44, 1, 12, 'Sent another followup email - 25/03', '2024-03-24 11:51:28', '2024-03-24 11:51:28'),
	(45, 1, 13, 'Sent a followup email.', '2024-03-24 12:43:18', '2024-03-24 12:43:18'),
	(46, 1, 5, 'sent a followup email.', '2024-03-24 12:45:38', '2024-03-24 12:45:38'),
	(47, 1, 8, 'Gary just responded that he\'ll do the job this week but no locked in date yet.', '2024-03-24 13:10:32', '2024-03-24 13:10:32'),
	(48, 1, 32, 'Adrian - info@everglowelectrical.com.au (Installer) - sent the job offer last 22/04 and sent another email today.', '2024-03-24 13:37:09', '2024-03-24 13:37:09'),
	(49, 1, 6, 'No update yet.', '2024-03-24 14:14:04', '2024-03-24 14:14:04'),
	(50, 1, 14, 'No Update from Alpha yet.\r\n\r\nSent a followup email.', '2024-03-24 14:16:46', '2024-03-24 14:16:46'),
	(51, 1, 14, 'informed client about no update from Alpha', '2024-03-24 14:18:46', '2024-03-24 14:18:46'),
	(52, 1, 37, 'The manufacturer is requesting tests be performed.\r\n\r\nI sent an email to the client regarding the required tests requested by the manufacturer.', '2024-03-24 14:35:07', '2024-03-24 14:35:07'),
	(53, 1, 20, '17 days still no update from Alpha.', '2024-03-24 17:03:03', '2024-03-24 17:03:03'),
	(54, 1, 7, 'Solis assisted and issue has been sorted as per clients email.', '2024-03-25 10:47:09', '2024-03-25 10:47:09'),
	(55, 1, 8, 'Sen\'t a followup email to the intaller.', '2024-03-26 11:59:11', '2024-03-26 11:59:11'),
	(56, 1, 12, 'Alpha advised it will take another 2 weeks but sent them with link of CEC find installer to outsource installers.', '2024-03-26 12:16:01', '2024-03-26 12:16:01'),
	(57, 1, 38, 'Mohammed has confirmed that he received the cables he requested and he booked the completion of the installation this coming 5th of April 2024.', '2024-04-01 14:12:30', '2024-04-01 14:12:30'),
	(58, 1, 6, 'Just need to confirm if the meter arrived with the client.', '2024-04-01 15:58:00', '2024-04-01 15:58:00'),
	(59, 1, 6, 'then alpha will take care of the installer.', '2024-04-01 15:58:56', '2024-04-01 15:58:56'),
	(60, 1, 5, 'Gavin from Tech support will provide an update today or tomorrow morning on the installer.', '2024-04-01 16:07:23', '2024-04-01 16:07:23'),
	(61, 1, 12, 'The battery was replaced today, and the faulty unit was collected by the manufacturer\'s contractor.', '2024-04-01 16:52:35', '2024-04-01 16:52:35'),
	(62, 1, 8, 'Spoke with Gary that the inverter has been swapped over and the cables on the roof has been rectified, he will comeback to the place to take additional photos.', '2024-04-01 17:48:40', '2024-04-01 17:48:40'),
