	(613, 1, 149, 'SAJ: Sorry for the late reply. Our team is investigating this issue, and monitoring the system for last 2 days. Unfortunately they didn\'t find any alarms when this occurred and it didn\'t happen in last 2 days as well. We have reset the export limit settings, and will monitor this system for more details, thanks for your understanding.', '2024-09-02 12:21:57', '2024-09-02 12:21:57'),
	(614, 1, 149, 'Saj responded 28 Aug; I sent a followup email today.', '2024-09-02 12:22:23', '2024-09-02 12:22:23'),
	(615, 1, 151, 'He tested out the grid and backup cabling and they were correct.<br><br><br>\r\n\r\nAll of the existing backup circuits are on the backup side.<br><br><br>\r\n\r\n\r\nThe battery was empty and not charging from what he could see when onsite. If the battery is empty and the grid goes down then the backup circuits will not work.<br><br><br>\r\n\r\nJarrod was on the phone with tech support trying to get the unit connected to the internet with no results.<br><br><br>\r\n\r\nTo get this looked at remotely by Alpha-ess it needs to get connected to the internet which it would not connect after several tries.<br><br><br>\r\n\r\nIf you have any questions please let me know.', '2024-09-02 13:32:21', '2024-09-02 13:32:21'),
