REPLACE INTO `tickets` (`id`, `ticket_number`, `user_id`, `the_client`, `serial_number`, `title`, `message`, `priority`, `status`, `is_resolved`, `is_locked`, `assigned_to`, `created_at`, `updated_at`) VALUES
	(1, '032401', 1, 5256, NULL, 'Inverter and Battery Faulty', 'Sungrow confirmed that the inverter and battery is faulty and approved a replacement.\r\n\r\nThe replacement inverter, battery, and battery MCB have been delivered to the client\'s place.', 'normal', 'resolved', 0, 0, 13, '2024-03-04 13:30:29', '2024-06-21 04:38:21'),
	(3, '032403', 1, 4126, NULL, ' KStar Inverte approve replacement', 'Inverter is confirmed to be faulty and a replacement has been approved.', 'normal', 'resolved', 0, 0, 13, '2024-03-11 11:19:46', '2024-06-21 04:38:26'),
	(4, '032404', 1, 7267, NULL, 'Waiting Status and Blank Screen', 'Possibly DC switch is off and the inverter went to standby.', 'low', 'resolved', 0, 0, 13, '2024-03-11 11:35:53', '2024-06-21 04:38:32'),
	(5, '032405', 1, 5377, 'AL2002221080564', 'Sample Fault', 'Inverter is confirmed to be replaced and the replacement is estimated to arrive today.\r\n\r\nhttps://www.mainfreight.com/track/MSAUS/55116142871?lang=en-NZ', 'normal', 'resolved', 0, 0, 13, '2024-03-11 11:48:54', '2024-06-21 04:38:40'),
	(6, '032406', 1, 5795, 'AL7011022100861', 'System performance', 'Joan, Ian Hunter\'s partner, called 12/03/24 and reported that the system is not working correctly.\r\n\r\nNeed to check the system for possible issues.', 'low', 'closed', 0, 0, 13, '2024-03-11 12:02:44', '2024-06-30 23:58:26'),
	(7, '032407', 1, 4511, NULL, 'Breaker keeps tripping', 'Sent a guide to online monitoring to see the error remotely.', 'low', 'resolved', 0, 0, 13, '2024-03-11 13:16:03', '2024-06-21 04:37:52'),
	(8, '032408', 1, 5403, NULL, 'Inverter replacement and rectification', 'The inverter needs to be replaced, and the cables on the roof have melted.\r\n\r\nGary Baker has confirmed to do the rectification and inverter replacement for $150+gst.\r\n\r\nWe are still waiting for the inverter replacement. 12/03/2024', 'normal', 'resolved', 0, 0, 13, '2024-03-11 13:18:29', '2024-06-21 04:37:43'),
	(9, '032409', 1, 3807, NULL, 'AC Voltage Too High', 'Client is insisting that the issue is not the the manufacturer.\r\n\r\nSent email to the manufacturer to check the system and give us access to the clients system.', 'low', 'closed', 0, 0, 13, '2024-03-11 13:46:06', '2024-04-08 20:16:31'),
	(10, '032410', 1, 7220, NULL, 'Consumption Too High', 'William reported that they don\'t have any AC and just using normal lights, TV and a fridge and his consumption reaches more than 8KW to 10KW.', 'low', 'resolved', 0, 0, 13, '2024-03-11 15:01:46', '2024-06-21 04:37:30'),
	(11, '032411', 1, 3477, NULL, 'Zeversolar Warranty Claim - CA-APAC-00059879', 'To be lodged.\r\n\r\nWaiting for Grants report and photos', 'normal', 'resolved', 0, 0, 13, '2024-03-12 11:28:59', '2024-06-21 04:37:21'),
	(12, '032412', 1, 5056, NULL, 'Battery faulty', 'The client already received the battery replacement and now waiting for an update from Alpha for the field team to do the replacement.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:10:22', '2024-06-21 04:36:57'),
	(13, '032413', 1, 6941, 'WO100781', 'B3+ Replacement', 'Alpha has confirmed that the unit needs to be replaced.\r\n\r\nAlpha is now outsourcing installers to do the replacement because our installer Saj is very far from the clients address.', 'normal', 'resolved', 0, 0, 2, '2024-03-12 14:14:20', '2024-06-21 04:36:50'),
	(14, '032414', 1, 6087, NULL, 'BMS board replacement', 'Due to Bat_overvolt_hardware_fault	found on the clients system, Alpha decided to replace the bms board.\r\n\r\nAlpha is arranging their own tech to do the replacement.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:19:09', '2024-06-21 04:36:09'),
	(15, '032415', 1, 4560, NULL, 'Solis Inverter Replacement', 'The client hired their own technician to do the inspection and installation.\r\n\r\nThe system was replaced between 4 to 8 March and now working.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:28:41', '2024-06-21 04:35:59'),
	(16, '032413', 1, 4974, NULL, 'Inverter and Battery Replacement', 'The inverter and battery replacement arrived, and Leigh, the contractor, has confirmed that he will do the replacement.\r\n\r\nNote; system was replaced like 3 to 4 times already.', 'low', 'closed', 0, 0, 13, '2024-03-12 14:37:44', '2024-03-24 11:48:27'),
	(17, '032417', 1, 7171, NULL, 'System Inspection', 'Client reported that there\'s a fire hazard about the ohms that registering on the app.\r\n\r\nSaj arranged a date to inspect the system - 15-02-24', 'low', 'resolved', 0, 0, 13, '2024-03-12 16:06:31', '2024-06-21 04:35:25'),
	(18, '032417', 1, 5274, NULL, 'Solis Inverter Replacement', 'The inverter was soaked in water, and Solis approved a replacement as a good will something hehe.\r\n\r\nSolis arranged for their own subcontractor and replaced the system.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 16:09:24', '2024-06-21 04:35:15'),
	(19, '032419', 1, 2067, NULL, 'Exposed wire replacement', 'Client reported that a cable from their backup system was cracked and exposed.\r\n\r\nClient paid for a service to replace the cable', 'low', 'resolved', 0, 0, 13, '2024-03-12 16:12:59', '2024-06-21 04:35:02'),
	(20, '032420', 1, 5512, 'AL7002223041060', 'EEPROM - Inverter replacement', 'Client had EEPROM error and Alpha confirmed to replace the inverter.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 16:22:59', '2024-06-21 04:34:38'),
	(21, '032421', 1, 5351, NULL, 'UPS Installation', 'Simon Mibus has confirmed to complete the UPS installation last 26 February.', 'low', 'on_hold', 0, 0, 13, '2024-03-12 16:28:42', '2024-08-01 02:09:07'),
	(22, '032422', 1, 3828, NULL, 'Zeversolar warranty claim', 'Checklist and photos have been forwarded by the clients subcontractor and already submitted to the manufacturer.', 'low', 'resolved', 0, 0, 13, '2024-03-12 16:38:39', '2024-06-21 04:34:15'),
	(23, '032423', 1, 7228, NULL, 'Lost Comm Inverter and Grid Meter', 'Client reported that the battery is not charging and it was confirmed by SAJ tech that it needs to be inspected physically.\r\n\r\nSaj agreed to check it since he is going back to the place  to complete the backup installation.', 'normal', 'resolved', 0, 0, 13, '2024-03-12 17:07:01', '2024-06-21 04:34:05'),
	(26, '032426', 1, 6089, NULL, ' Backup system only providing power to garage', 'Client called that backup works but only providing power to the garage. \r\n\r\nAli Akbar is the installer.', 'normal', 'on_hold', 0, 0, 13, '2024-03-14 12:16:20', '2024-06-21 04:32:56'),
	(32, '032432', 1, 4460, NULL, 'GRID-INTF', 'GRID-INTF  indicates that there will be issue on the grid side of inverter, this includes checking full AC connection and checking the earth leakage to PV, because it there is current leaking into earth it will cause interference, because PV and AC are sharing same Earth.\r\n\r\n \r\n\r\nFull check of AC components required and Megger of PV.\r\n \r\n\r\nHere is the form that your installer must fill up.', 'normal', 'resolved', 0, 0, 13, '2024-03-18 18:44:43', '2024-06-21 04:32:34'),
	(37, '032437', 1, 3814, NULL, 'Error 35', 'Warranty submited\r\nReference:  CA-APAC-00059887', 'normal', 'resolved', 0, 0, 13, '2024-03-20 13:48:22', '2024-08-01 02:16:39'),
	(38, '032438', 1, 7436, NULL, 'Battery retrofit requires additional cable', 'Mohammed requires a long cable to install the new battery in the current system because the location of the existing battery doesn\'t have enough room for an additional battery.\r\n\r\nMohammed is not communicating with Syed Raza (energizer tech) to get the cable issue sorted.', 'low', 'closed', 0, 0, 13, '2024-03-24 13:34:02', '2024-04-10 14:14:55'),
	(39, '032439', 1, 5739, NULL, 'Installation Issue (Design- 2 Meters)', 'Sungrow Tech has confirmed that the design and installation are incorrect, and they advised that it\'s possibly the cause of intermittent power issues because of the two smart meters that receive incorrect references, or both meters can cause reference issues. \r\n\r\nI have informed Paul but he\'s not happy to rectify the issue and wants $1000 to do the work which the issue is with how he installed it.\r\n\r\nThough, I haven\'t confirmed yet who designed the system which is one of the reason why it was installed incorrectly.', 'low', 'on_hold', 0, 0, 13, '2024-04-01 15:00:14', '2024-06-21 04:31:17'),
	(40, '042440', 1, 7427, NULL, 'Dongle Installation', 'Client doesn\'t want to install the new dongle replacement that was sent to him so we arranged Nash to assist him with the installation and it\'s confirmed this coming 11th April 2024.', 'low', 'resolved', 0, 0, 13, '2024-04-01 15:32:45', '2024-06-21 04:28:59'),
	(41, '042441', 1, 3280, NULL, 'System Issue? Zeverlution 4000', 'Client Called about issue- \r\nNeed a call back 0417787598', 'low', 'on_hold', 0, 0, 13, '2024-04-03 13:54:28', '2024-06-21 04:29:09'),
	(42, '042442', 1, 7447, NULL, 'PV1 String No Production', 'Confirmed with Online monitoring that his PV1 is not generating.\r\n\r\nInstaller is Levi Van voorthuizen (Jonathan Clack)', 'low', 'resolved', 0, 0, 13, '2024-04-03 15:20:40', '2024-06-21 04:24:16'),
	(43, '042443', 1, 5870, NULL, 'Inverter Dongle issue', 'Adam is aware, dongle is damaged by the installer.\r\n\r\nInstaller doesn\'t want to go back.\r\n\r\nNeeds Adams decision.', 'low', 'on_hold', 0, 0, 13, '2024-04-04 15:40:58', '2024-07-01 00:58:57'),
	(52, '042452', 1, 4974, NULL, 'Inverter And Battery Replacement', 'Inverter and battery are replaced, the faulty units needs to be collected.', 'low', 'closed', 0, 0, 13, '2024-04-04 18:34:48', '2024-06-02 23:03:53'),
	(53, '042453', 1, 2672, NULL, 'New Battery Installed causing system issues', 'After the RedX battery was installed, the existing battery and inverter is showing 6 errors and it causes the existing system to stop working.\r\n\r\nError Codes;\r\n005\r\n010\r\n014\r\n084\r\n703\r\n735', 'high', 'on_hold', 0, 0, 13, '2024-04-07 16:14:56', '2024-06-21 04:29:57'),
	(54, '042454', 1, 7458, NULL, 'Backup Circuit and Changeover Switch', 'He has informed us that his fridge is not connected to the EPS and he\'s requesting a changeover switch for his hot water service.\r\n\r\nAdditionally, he mentioned that all other power points are connected to the EPS except for the fridge.', 'low', 'resolved', 0, 0, 13, '2024-04-07 17:49:13', '2024-06-21 04:24:12'),
	(55, '042455', 1, 6417, NULL, 'High Electricity Bills', 'Client have two phase power with two rate metering.\r\n\r\nNeed advise from Adam about this setup.', 'low', 'on_hold', 0, 0, 13, '2024-04-07 20:24:24', '2024-06-21 04:30:58'),
	(56, '042456', 1, 2623, NULL, 'Online Montioring account not working', 'Client has zeversolar and zeversolar platform has merged with Solplanet.\r\n\r\nSent client a guide on how to reset the password using the Solplanet website.', 'low', 'resolved', 0, 0, 13, '2024-04-08 15:27:44', '2024-06-21 04:21:08'),
	(58, '042458', 1, 7014, '66DH50201A7N007', 'Battery Faulty', 'Kenneth confirmed that the battery is faulty and needs to be replaced last Feb 14', 'high', 'resolved', 0, 0, 13, '2024-04-08 19:13:25', '2024-06-21 04:20:47'),
	(59, '042459', 1, 7090, NULL, 'Firmware Update Required', 'Battery was replaced but requires a manual firmware upgrade.\r\n\r\nFirmware has been forwarded to Max Rowe but stilll waiting for him to get back to me with a date.', 'low', 'resolved', 0, 0, 13, '2024-04-08 19:54:18', '2024-06-21 04:00:32'),
	(60, '042460', 1, 5833, NULL, 'Backup Issue', 'Client has confirmed that the backup is not working.\r\n\r\nSaj the installer advised that he needs to go back to install the changeover switch and fix the backup but no date yet.', 'low', 'resolved', 0, 0, 13, '2024-04-09 14:47:39', '2024-06-21 03:59:38'),
	(61, '042461', 1, 5674, NULL, 'GridVoltFault', 'Belynda reported that her export wasnt approved and she has a high bill.\r\n\r\nMichael Barnett complained to me that the system wasn\'t working for 2 months, which it was never reported. Which I cannot fix or assist if I have no idea.\r\n\r\nMichael Barnett tried to blame me for issue that was not reported to me.\r\n\r\nMichael also reported that the fault was "grid fault" but upon checking that fault only happened once.\r\n\r\nSent Belynda an email about the issue that only happened one time last 29th Feb and asked for a proof that her system is not working correctly until now.', 'low', 'on_hold', 0, 0, 13, '2024-04-09 17:19:32', '2024-06-21 03:58:02'),
	(63, '042463', 1, 2588, 'R48189P3SBMA171223701', 'LG Battery Recall', 'LG will reimburse us $300.', 'low', 'resolved', 0, 0, 13, '2024-04-10 19:45:10', '2024-06-21 03:57:52'),
	(64, '042464', 1, 5417, NULL, 'Dongle Replacement', 'Client paid $99 for a new dongle.\r\n\r\nDongle was dropped off to Au post street posting box yesterday.', 'low', 'resolved', 0, 0, 13, '2024-04-12 00:21:22', '2024-06-21 03:57:39'),
	(65, '042465', 1, 4960, 'STE20240402-01097', 'Tesla Gateway Issue', 'Gateway has burn marks.', 'low', 'resolved', 0, 0, 13, '2024-04-12 03:28:31', '2024-06-21 03:57:22'),
	(66, '042466', 13, 6059, 'STE20201026-00165', 'Internal Fault Requires Replacement', 'Clients Report: My telstra app shows a fault with powerwall and can l schedule a time to this to be serviced next week on either monday 22 Wednesday 24 Thursday or friday 24 april\r\nFault message on powerwall app.\r\n\r\nTesla Ticket Number: SV018C1510', 'low', 'resolved', 0, 0, 13, '2024-04-15 00:07:00', '2024-06-21 03:57:16'),
	(68, '042468', 1, 3433, 'ZD50000111911146', 'Reconnecting Status', 'Client reported that the system is showing reconnecting. We tried turning off and on the system but the reconnecting status reappears. After the reboot the system back to normal but shows reconnecting after a minute or two.', 'low', 'resolved', 0, 0, 13, '2024-04-15 06:22:52', '2024-06-21 03:56:05'),
	(69, '042469', 1, 7489, 'ALD011123080018', 'Battery Not working since installation', 'Spoke with Alan and guided him on how to switch on the system but we failed.\r\n\r\nAlan also advised that the system was signed off by the inspector even the battery wasn\'t turning on.\r\n\r\nsent information to will (installer) and wainting for his response.', 'low', 'resolved', 0, 0, 13, '2024-04-18 02:35:46', '2024-06-21 03:55:47'),
	(70, '042470', 1, 7312, NULL, 'Battery has fault', 'Hinal~~~ This customer\'s battery is displaying a fault. I informed him that you will follow up with them on Monday.', 'low', 'closed', 0, 0, 13, '2024-04-19 02:01:31', '2024-05-02 02:58:33'),
	(71, '042471', 1, 5399, '7418225F-0D', 'Inverter production issue detected', 'Inverter - Production issue detected. There\'s a production but very low.', 'low', 'in_progress', 0, 0, 13, '2024-04-19 03:58:40', '2024-07-08 04:17:56'),
	(72, '042472', 1, 5244, NULL, 'Power interruption caused by the Battery', 'Neville reported that last Monday there was a 6:50 PM power interruption, but it was confirmed that there was no power outage from the mains or street. He hired a local sparky, and the sparky disconnected the battery. The power to his house is back, confirming that the cause of the outage was the batter\r\n\r\nMatt hanes -may 20 - 0404864381', 'low', 'on_hold', 0, 0, 13, '2024-04-19 04:14:13', '2024-06-21 02:25:08'),
	(73, '042473', 1, 823, NULL, 'System Error', 'Client reported that the system has error.\r\n\r\nSystem was installed 10 years ago. Aurora inverter\r\n\r\nSent email to client about he warranty and manual reset.', 'low', 'closed', 0, 0, 13, '2024-04-22 03:32:03', '2024-05-02 03:24:27'),
	(74, '042474', 1, 3143, NULL, 'Solax Inverter Issue', 'Client has just called and reported an error on one of their 2 inverters.\r\n\r\nEarly 2019 install. system installed 61 months ago.\r\nQuote a $285 Inc call out fee.', 'low', 'resolved', 0, 0, 13, '2024-04-22 05:41:41', '2024-06-21 03:54:52'),
	(75, '032475', 1, 1670, NULL, 'Growatt inverter no power', 'Client reported that the inverter doesn\'t have a power and we tried the manual reset still no power. But upon checking on the photos that they submitted, the Main switch is pointing to off position.\r\nI sent a text to confirm the status of the breaker, If the main power supply breaker is off then that\'s the reason why the inverter is off as well.', 'low', 'resolved', 0, 0, 13, '2024-04-22 06:54:13', '2024-06-21 03:54:02'),
	(76, '042476', 1, 7312, 'ALD011123080065', 'Grid Meter Lost Fault', 'Client reported that the system is showing "Grid Meter Lost Fault".', 'low', 'resolved', 0, 0, 13, '2024-04-22 23:15:15', '2024-06-21 03:53:35'),
	(77, '042477', 1, 7054, 'A2010073826', 'Error Code 045', 'Inverter Confirmed faulty and approved for replacement', 'low', 'resolved', 0, 0, 13, '2024-04-22 23:27:30', '2024-06-21 03:53:06'),
	(79, '042479', 1, 4699, NULL, 'Melted Micro inverter and Damaged One Jinko Panel', 'Client has reported that one of the micro inverter has caught fire and the panel where the microinverter was attached was also damaged.', 'low', 'resolved', 0, 0, 13, '2024-04-23 01:52:41', '2024-07-08 03:41:50'),
	(80, '042480', 1, 7225, NULL, 'Off Grid Installation', 'Oliver the installer is installing the system for the first time.', 'low', 'resolved', 0, 0, 13, '2024-04-24 02:39:18', '2024-06-21 03:52:52'),
	(81, '042481', 1, 5727, 'ALD071023060014', 'Data descripancy and performance issue??', 'The client reported that there\'s been a data discrepancy and performance issue for the last 3 weeks.\r\n\r\nClient Sungrow inverter with battery and an ac coupled alpha ess battery installed.\r\n\r\nSungrow is not connected to the internet.\r\nAlpha is connected to the internet.', 'low', 'closed', 0, 0, 13, '2024-04-24 03:44:37', '2024-05-02 03:39:50'),
	(82, '042482', 1, 6533, 'R5X2502J2344E59963 / H2S3992J2338E05380', 'Battery Lost communication', 'We require your assistance to conduct a diagnostic test on a client\'s system.\r\n\r\nOur client experienced a power outage on the night of April 24th, during which there were no mains power disruptions. Our installer confirmed the next day that the system caused the interruption.\r\n\r\nThe system reported a \'BMS Communication Lost Error\' with the code \'H2S3992J2338E05380\' at 7:01:11 PM on April 24th.\r\n\r\nYesterday, our installer returned to install a changeover switch. However, upon activating the inverter and battery, the battery failed to engage, and the inverter remained in standby mode.\r\n\r\nThe system operated flawlessly for three months prior to this incident. Our installer assures that the installation was correct and has exhausted all troubleshooting options without success.\r\n\r\nTemporarily, the battery has been switched off until your team can perform a diagnostic test.\r\n\r\nOur installer has briefed the client on activating the battery once your team guides him through the necessary tests over the phone', 'high', 'resolved', 0, 0, 13, '2024-04-25 23:38:36', '2024-06-21 03:52:20'),
	(83, '042483', 1, 6491, 'Smile5 INV + ALPHA_SMILE-BAT-13.3P', 'Backup Plug Missing', 'From Steph: \r\nYou went to the below customers house last year but you were unable to complete the UPS backup due to a missing part, Do you have the part to complete this or not?\r\n\r\n\r\nIf not, What is the part? We are needing this completed in the next couple of weeks so if you could let me know asap and I can organise a part if needed and When would you like to go back?', 'low', 'resolved', 0, 0, 13, '2024-04-26 00:39:56', '2024-06-21 03:52:00'),
	(84, '042484', 1, 5967, 'AL7002223040397', 'System Performance', 'I\'m hoping you can make a bit of sense out of the attached PDF file\r\nI have put together. I been monitoring the Battery system since you\r\ngot it up and running. You set the original discharge times for one\r\nhour twice a day between 6.00am. and 7.00 am  of a morning and\r\n1800hrs and 1900hrs of an evening. I have experimented with \r\nchanging the discharge times from the one hour through to two\r\nand three hours with strange results. I will let you study it for a \r\nwhile and maybe you can explain it in simple terms for me later on.\r\nDue to the anomalies in the discharging I am going to monitor it\r\nof an evening over the week to ten days as it is set  for two hours\r\ndischarge between 5.30am. and 7.30am. of a morning and 1700hrs\r\nto 1900hrs of an evening and I will be in touch later next week.', 'low', 'on_hold', 0, 0, 13, '2024-04-26 01:35:14', '2024-06-21 04:30:24'),
	(85, '042485', 1, 5466, NULL, 'System fault and battery empty', 'Client called that the system is showing fault and the battery is off. She also noted that there was a power outage weeks ago.', 'low', 'resolved', 0, 0, 13, '2024-04-26 01:37:10', '2024-06-21 03:51:35'),
	(86, '042486', 1, 3224, 'R6S3103J2336E27012', 'System Performance Issue', 'Client reported that the system is not generating correctly or it\'s generating very low.', 'low', 'resolved', 0, 0, 13, '2024-04-26 02:50:13', '2024-06-21 03:51:18'),
	(87, '042487', 1, 4974, NULL, 'System trips', 'The client has informed us that the new system is functioning, but it has tripped twice already, requiring a manual restart to resume operation.', 'low', 'on_hold', 0, 0, 13, '2024-04-26 03:18:33', '2024-06-21 04:29:37'),
	(88, '042488', 1, 5880, 'AL2002221080696', 'Battery Shutting Dow Unexpectedly / Sample Fault', 'We purchased a solar + battery system from you in late 2020. Recently we have been having issues with the battery shutting down unexpectedly and taking the back-up circuits with it (lights and 2 power point circuits). This has been happening during the day until last night when it happened at about 6.30pm, which was a bit inconvenient. I would be grateful if someone could assist. Regards, Damien', 'low', 'resolved', 0, 0, 13, '2024-04-29 01:26:24', '2024-08-05 00:43:15'),
	(89, '042489', 1, 5870, NULL, 'Grid Fault Error / Unit 7 Inverter not connected to the internet', 'Client and Michael Barnett was claiming to have a grid fault on the system for weeks but couldn\'t provide a proof or a confirmation.\r\n\r\nThere are two things needs to be confirmed or done to this client. 1. Confirm the grid fault if it\'s on-going. 2. Re-configure the unniit 7 to be connected to the internet.', 'low', 'on_hold', 0, 0, 13, '2024-04-29 01:57:24', '2024-06-21 04:29:24'),
	(90, '052490 ', 1, 4490, NULL, 'System Down', 'Gisela Pineiro\r\ngisela.pineiro@gmail.com\r\n\r\nWeve just been through a storm and our system is down. Weve done the usual to restart but nothing is on. The red inverter has no lights, the yellow inverter has no lights and the battery light is flashing between blue and white.', 'low', 'resolved', 0, 0, 13, '2024-04-30 02:38:05', '2024-06-21 03:50:51'),
	(91, '052491', 1, 7141, 'A2010233829', 'Inverter faulty', 'Special Instructions.\r\n\r\nRequest a Sungrow SG5.0RS be supplied and dispatched.\r\nAustrorised by Scott Su (Sungrow Service and Technical Support Director)\r\nPlease ensure that we apply for the $165 inc reimbursement.', 'low', 'resolved', 0, 0, 13, '2024-04-30 23:40:32', '2024-06-21 03:50:37'),
	(92, '052492', 1, 6386, '66DH50201A7N011', 'Faulty AIO', 'Luke Thornton has installed the Fox ESS unit and has advised that there is a fault.\r\n\r\nHe says that he has already lodged a warranty matter with Fox and a new unit is being sent to him.\r\n\r\nPlease follow him up for the case number and keep me posted.', 'low', 'resolved', 0, 0, 13, '2024-05-01 06:56:54', '2024-06-21 03:48:23'),
	(93, '052493', 1, 7431, 'XS8802216013160', 'AC10M Volt Fault', 'The AC10M Volt Fault is caused by the grid\'s voltage(electricity provider) being more than 250V for 10 minutes.\r\n\r\nRussell Andrew:I spoke to Origin Energy on the phone yesterday. They tell me this is not an issue of their own. \r\nI dont have an online monitoring account as none of this information has been provided to me.', 'low', 'closed', 0, 0, 13, '2024-05-03 01:13:58', '2024-07-04 03:16:16'),
	(94, '052494', 1, 7300, 'AL7002222060780', 'Power interruptions', 'Client reported that the system causing power interruption.', 'low', 'closed', 0, 0, 13, '2024-05-03 01:22:12', '2024-05-03 01:23:30'),
	(95, '052495', 1, 7416, 'ST1AS407N2L146', 'Inverter Offline', 'My app is showing that my inverter is off line. Any clues as to why this is?', 'low', 'resolved', 0, 0, 13, '2024-05-06 00:44:04', '2024-07-04 03:17:46'),
	(96, '052496', 1, 5326, NULL, 'System Alarm', 'Client called that he keeps receiving an email from Solis that his system has detected an alarm.', 'low', 'closed', 0, 0, 13, '2024-05-06 01:04:05', '2024-06-12 23:37:18'),
	(97, '052497', 1, 1770, NULL, 'Faulty Solaredge', 'Client advised that Nathan Dawson performed a system check and it found out that the system was confirmed faulty and the inverter is under 10 year warranty.\r\n\r\nI sent an email to Nathan for the inspection report and photos.', 'low', 'in_progress', 0, 0, 13, '2024-05-06 02:24:54', '2024-07-08 04:19:18'),
	(98, '052498', 1, 6382, '3804010233250013', 'Production Low since April', 'Client noticed that the production is low since April, he cleaned the panels but it has no affect on the production **Ian Howard', 'low', 'resolved', 0, 0, 13, '2024-05-09 06:10:02', '2024-07-04 04:08:18'),
	(99, '0524099', 1, 5736, '58000DTA225W0038', 'Inverter Making Loud Noise', 'Michael Barnett has reported that one of his client has complained about inverter making loud noise. I explained to michael that it\'s normal but he insisted that the loud noise is not normal and he want\'s it replaced.', 'low', 'resolved', 0, 0, 13, '2024-05-09 22:54:13', '2024-06-21 03:46:16'),
	(100, '0524100', 1, 5739, 'A22A3111823', 'Battery Issues', 'From Peter:<br>\r\nDARYL WE REALLY NEED TO GET SOMEONE OUT TO MY HOME \r\nTO CHECK OVER THIS SYSTEM  ASAP \r\nI need a hands on person on site \r\nAbove photo is this morning  9th may  2024 \r\nS/N  A22A3111823     AND  804  inverters \r\n\r\nYesterday the power went off again and we had power to the house for only 20 mins\r\nas the battery bank on the left  ran out of  power and the battery bank on the right  was full \r\nbut  the system did not swap over\r\nThe battery on the right is always full and the battery on the Left is discharging  first \r\nso i guess the battery on the right is not set up to discharge or power the house \r\n \r\nThis is becoming really frustrating now the system is working when the sun comes out \r\nbut why we cannot get more than  20 mins out of  a 8 battery and 72 panel  system is \r\nbeyond me \r\nI really need someone out here Daryl to sort this out', 'low', 'resolved', 0, 0, 13, '2024-05-13 04:12:25', '2024-08-28 12:47:09'),
	(101, '0524101', 1, 4967, '130AC2211180553', 'No-Grid Fault', 'Client reported that his inverter is showing no-grid fault even the breaker is on.', 'low', 'resolved', 0, 0, 13, '2024-05-13 23:11:08', '2024-07-17 23:51:26'),
