	(103, '0524103', 1, 7250, 'ALD011123070326', 'Suspected Installation Issue with Grid CT Direction', 'Client reported that his Bill increased. \r\n\r\nAs per the data from the platform, iIt is suspected there is an installation issue, please contact the installer to check the direction of the grid CT.', 'low', 'resolved', 0, 0, 13, '2024-05-14 23:03:21', '2024-06-21 03:45:30'),
	(104, '0524104', 1, 5854, 'ALA001021090833', 'Alpha Battery Failure with Online Monitoring Enabled', 'Hinal: The customer has two Alpha batteries and one of them is not working. He has the online monitoring for the system.', 'low', 'resolved', 0, 0, 13, '2024-05-15 03:21:19', '2024-06-21 03:44:52'),
	(105, '0524105', 1, 7276, '380403022C220013', 'System Production Issue', 'Hinal: His system is not functioning properly. It\'s a 13kW system, and since last week, it has only been generating 1.2kW per day.', 'low', 'resolved', 0, 0, 2, '2024-05-16 00:51:34', '2024-06-21 03:44:22'),
	(106, '0524106', 1, 1536, NULL, 'Riso Low', 'In June 2011 Solarlink supplied to us a 2.5 kW PV system, which was installed by ADIWA Electrical services. A few days ago I noticed that the system was down with a \'Riso Low\' notice on the inverter display. I restarted the inverter but no change, i.e. the system would not initialize. I did some research which suggested I inspect the panels for any yellowing/browning around the panel cells. What I found was that at least one cell has a very brown \'framing\' and a whole lot of cells show yellowing. \r\nCould you please send out a technician to make an expert inspection and necessary measurements and subsequently let me know what my next\r\nsteps are? \r\nI have read the terms of the warranty provided by Solarlink and I believe that I am eligible for this warranty agreement to be honoured.', 'low', 'closed', 0, 0, 2, '2024-05-16 02:38:59', '2024-05-16 03:52:28'),
	(107, '0524107', 1, 4623, '030AC1201070242', 'LimbyVG', 'I continue to have a fault showing on my Solis 4g inverter .  Code number is LimByVg\r\n\r\nAus net say that it is not a fault at their end and that the voltage needs to be re-set at 250v\r\n\r\nCan you advise (0491163183)', 'low', 'resolved', 0, 0, 2, '2024-05-16 03:56:11', '2024-07-04 04:26:40'),
	(108, '0524108', 1, 3764, '110212238936601000244', 'Kstar Error', 'Client just called and reported an error.\r\n\r\nThey don\'t have email.', 'low', 'closed', 0, 0, 2, '2024-05-16 23:07:27', '2024-06-11 05:04:30'),
	(109, '0524109', 1, 4490, 'SMA CN: 407014163', 'PUK Code', 'needs PUK code to reset the installer password', 'low', 'resolved', 0, 0, 2, '2024-05-17 01:36:59', '2024-06-21 03:42:58'),
