	(113, '0524113', 1, 6261, NULL, 'System Fault', 'David called that his system is showing a fault. No other information.', 'low', 'resolved', 0, 0, 2, '2024-05-20 01:54:38', '2024-06-21 03:42:27'),
	(114, '0524114', 1, 6552, 'H2S2502J2338E05539', 'High Consumption', 'The system\'s single-phase smart meter was swapped out for a three-phase smart meter, but the load is abnormally high now that it has been replaced.', 'low', 'resolved', 0, 0, 2, '2024-05-21 05:44:01', '2024-06-21 03:42:13'),
	(115, '0524115', 1, 5046, NULL, 'UPS installation', 'Client paid for the deposit. Now wer are looking for an installer.', 'low', 'on_hold', 0, 0, 2, '2024-05-21 06:50:33', '2024-07-05 00:13:54'),
	(116, '0524116', 1, 5970, 'AL7011022110063', 'Production Query', 'Michelle  called and asked to check her batteries performance, she saying the battery is only charing 5kW. \r\nNeed to check the system.', 'low', 'resolved', 0, 0, 2, '2024-05-22 05:45:22', '2024-06-21 03:02:13'),
	(117, '0524117', 1, 6628, 'H2S2502J2339E05749', 'Battery Not Discharging', 'The customer contacted Hinal to report that the battery was not draining. After verifying, it was found that the system had detected a load during the battery\'s discharge; since the load data was not displayed, it is possible that this is what caused the battery to break. I raised this case with the manufacturer and will see what they have to say.', 'low', 'resolved', 0, 0, 2, '2024-05-24 00:02:28', '2024-07-04 03:16:50'),
	(118, '0524118', 1, 6443, 'A1AU10051190072', 'Battery Issues', 'I have tried to ring a couple of times about our solar battery performance.  Our elec account has hardly changed from pre solar installation to now.  I am wondering if something has to be checked or "restarted" to fire up our battery.  I spoke to someone about 6 weeks ago and tried to log into battery data log ?  No progress.\r\nThe battery screen does not come up much at all.  I press it many times in various places and it does rarely operate.\r\nThe power went off about a month ago and the battery did not carry on to supply our system.\r\nDoes this need some extra "service" or connection to take over when the mains goes off ?\r\nCould the batteries be "out of date". ?  Both batteries had a sticker on the box "must energize by 01 July 2023", with manufacture date of 2021-06-15.\r\nThe system was fitted 4.12.23 and switched on 13.12.23  This is past the energise date.\r\nI am left wondering what may be at fault ?', 'low', 'on_hold', 0, 0, 2, '2024-05-24 01:00:31', '2024-07-04 04:42:31'),
	(119, '0524119', 1, 7579, '122327132273', 'Gateway Meter Measurements Error', 'The Relay open error has been resolved and there\'s another issue reported.\r\n\r\n"There is an issue with your gateway meter measurements"', 'low', 'resolved', 0, 0, 2, '2024-05-24 02:20:54', '2024-06-21 03:01:45'),
	(120, '0524120', 1, 7432, 'H2S3802J2338E05476', 'SAJ Wifi Reconnection', 'The client is switching internet providers; while his current provider is still in operation, it will be disconnected on June 10th.\r\n\r\nSince the new internet provider is already operational, the client wants to make the change in advance.', 'low', 'resolved', 0, 0, 2, '2024-05-24 02:28:54', '2024-06-21 03:01:42'),
	(121, '0524121', 1, 1007, 'ALD001022060070', 'System Issues', 'Client reported that system has issues : Panels being disconnected and UPS not working.', 'low', 'on_hold', 0, 0, 2, '2024-05-26 23:00:09', '2024-08-19 16:31:12'),
	(123, '0524122', 1, 5389, NULL, 'System check', 'From Adam: \r\nClient called as she is not sure if here system is working well.\r\n\r\nWe initially installed a 6kw system with a Zeversolar 3 phase inverter.\r\n\r\nThe we AC coupled a battery a couple of years later.', 'low', 'on_hold', 0, 0, 2, '2024-05-28 23:25:53', '2024-07-05 01:02:36'),
	(124, '0524124', 1, 7276, '380403022C220013', 'Production Issue', 'Client complained that the production is really low.', 'low', 'resolved', 0, 0, 2, '2024-05-29 00:38:17', '2024-07-08 04:21:49'),
	(125, '0524125', 1, 6281, 'AL7011022090484', 'Fault Light Showing', 'Upon checking, the client\'s system has a PV meter lost fault. Based on my knowledge this client is using a wireless bridge to connect the meter and the system. Need to respond client in the next 48 hours ( this friday)', 'low', 'resolved', 0, 0, 2, '2024-05-29 01:37:56', '2024-07-01 03:12:30'),
	(126, '0524126', 1, 4560, '030AC123C090026', 'Dead Inverter', 'Both the replacement units have been operational when they were installed and all the inverters on the site have resulted in being dead. \r\n\r\nSummary:\r\nSolar link submitted claim on 21/07/2023. Case - G006360  FAULT  Dead Inverter. Inverter SN: 030AC1201070349. Solis replaced with inverter SN: 130AC2232230049\r\nSolar Link submitted another claim on 31/01/2024. Case - G007170  FAULT  Dead inverter. SN: 130AC2232230049. Solis replaced inverter with SN: 030AC123C090026\r\nSolar Link submitted another claim on 19/04/2024. Case- G007502- FAULT  Dead Inverter. SN: 030AC123C090026.\r\n\r\nSolis cannot take responsibility for these failures and we cannot provide any further support for this site. \r\n\r\nWe understand and appreciate that you have contracted qualified installers however, repeated failures at this particular site with multiple different inverters confirms there is external factor damaging the inverter.', 'low', 'in_progress', 0, 0, 2, '2024-05-29 03:45:54', '2024-07-08 04:22:15'),
	(127, '0524127', 1, 3119, NULL, 'Call Back Request', 'Client called requesting a call back.', 'low', 'resolved', 0, 0, 2, '2024-05-29 05:16:26', '2024-07-05 00:40:01'),
	(128, '0524128', 1, 7532, 'ALD011123080037', 'Growatt Inverter To Backup Cirtcuit', 'Growatt inverter needs to be added to the backup circuit to be able to work during blackouts.', 'low', 'resolved', 0, 0, 2, '2024-05-30 01:27:58', '2024-08-01 02:55:27'),
	(129, '0624129', 1, 3621, 'ZD50000111910615', 'Inverter melted inside', 'Client called and reported that their inverter melted. It\'s now isolated and safe. Clients son is an electrician.', 'low', 'resolved', 0, 0, 2, '2024-06-03 03:17:14', '2024-08-01 00:53:51'),
	(130, '0624130', 1, 7452, 'ALD011123080016', 'Battery Fault', 'Client :I am getting a battery fault BMS lost on my alpha ess system.', 'low', 'resolved', 0, 0, 2, '2024-06-03 03:25:35', '2024-06-21 03:01:39'),
	(131, '0624131', 1, 6660, 'R6S3103J2338E27514', 'Saj Error / Alarm Code', 'The client stated that there is an error or alarm code on his system. Per Adam Dolkin\'s report.', 'low', 'resolved', 0, 0, 2, '2024-06-03 05:50:37', '2024-07-08 04:27:17'),
	(135, '0624132', 1, 7416, 'ST1AS407N2L146', 'Wifi offline', 'Although the client has previously reported this problem, I think the problem is with his router because the system has not reported any errors.\r\n\r\nI contacted the manufacturer about this case to get their opinion on the potential problem with the signal strength.', 'low', 'resolved', 0, 0, 2, '2024-06-04 01:28:17', '2024-07-08 04:33:01'),
	(136, '0624136', 1, 7465, '380403023A210177', 'Breaker Tripping', 'Client called that the inverter is tripping and confirmed that the breaker size is 32A which the manual states that the out put is 45.9A.', 'low', 'resolved', 0, 0, 2, '2024-06-05 06:49:10', '2024-06-21 03:01:05'),
	(138, '0624138', 1, 6562, NULL, 'System Issues', 'The clients system was just replaced with battery and inverter and client is now saying that the system is showing a fault or error.', 'low', 'on_hold', 0, 0, 2, '2024-06-10 23:18:58', '2024-07-05 00:47:25'),
	(139, '0624139', 1, 7541, NULL, 'No power to the UPS circuit is causing a loss of power to the connected circuit', 'The UPS/EPS switch or breaker keeps tripping since last week; however, even though the breaker did not trip this time, no power was supplied, which resulted in no power to the connected circuit. The system is online and no faults have been recorded.', 'low', 'resolved', 0, 0, 2, '2024-06-10 23:54:01', '2024-07-05 00:13:34'),
	(140, '0624140', 1, 5974, 'AL7011022080004', 'Battery Issue', 'Steph: \r\n\r\nThis customer has mentioned that his current battery is discharging itself, it went down to 3.6 this morning \r\n\r\nAre there any issues showing online?\r\n\r\nTony Ray\r\n5 Foster-Mirboo Rd, Foster North, VIC, 3960\r\n0417005768\r\n\r\nSaj is going on the 28th and 29th, Does he need to do anything to fix it on site?', 'low', 'resolved', 0, 0, 2, '2024-06-11 01:14:20', '2024-07-08 04:34:59'),
	(141, '0624141', 1, 7489, NULL, 'Backup Circuits - Fridge and Garage door', 'Alan called that during the outage, the UPS worked but the fridge doesn\'t have any power.', 'low', 'closed', 0, 0, 2, '2024-06-11 01:50:15', '2024-07-04 04:41:57'),
	(142, '0624142', 1, 7540, NULL, 'System Check', 'Client called and reported that after the installation last March til June, there\'s no changes on his electricity.', 'low', 'on_hold', 0, 0, 2, '2024-06-11 01:57:31', '2024-07-08 04:36:02'),
	(143, '0624143', 1, 5854, 'ALA001021090833', 'System Error: Multi-Master-Error', 'Client system went off and there\'s a new error surfaced. \r\nMulti_Master_error, Phase_locked_fault, Grid_UFP, Grid_UVP', 'low', 'resolved', 0, 0, 2, '2024-06-12 01:00:02', '2024-06-21 03:41:37'),
	(144, '0624144', 1, 3653, 'ZD50000111920675', 'Error 35', 'Error 35, not detecting any AC from the grid.', 'low', 'resolved', 0, 0, 2, '2024-06-17 01:55:48', '2024-07-08 04:36:54'),
	(145, '0624145', 1, 5993, '9010KPSC21CW0028', 'System is online but the status is showing offline', 'The system appears to be offline, but it is actually online because data is being recorded, despite the client\'s claim that it is offline.\r\n\r\nPerhaps there is only a firmware or softwarre problem.', 'low', 'resolved', 0, 0, 2, '2024-06-19 00:01:15', '2024-07-08 04:38:14'),
	(146, '0624146', 1, 4947, '030932211040051', 'Fault Light On', 'client reported that the fault light is on.', 'low', 'resolved', 0, 0, 2, '2024-06-19 00:28:35', '2024-07-08 04:53:16'),
	(147, '0624147', 1, 2499, 'A1711143670', 'Inverter Offline', 'Unfortunately my system has gone offline again. \r\n\r\nCan you please log in and reset the system again? \r\n\r\nNot sure why this has happened, I havent changed anything at my end.', 'low', 'closed', 0, 0, 2, '2024-06-19 06:25:10', '2024-07-08 05:00:31'),
	(148, '0624148', 1, 6023, 'AL7011023030162', 'PV Generation', 'I have been monitoring my system in relation to PV generation for this month to date.\r\nThe original projection was that my system would generate an average of 10kwh per day for June.\r\nThe reality is substantially short of that.\r\nIn fact today (which was a clear sunny day all day) is the only day that has reached (not exceeded) the projected average.\r\nTo average 10kwh I would have expected the daily results to have maybe been fluctuating from 5 to 15 to achieve the projected 10.\r\nIn fact our winter so far has been very mild, with very few days of deep cloud cover and rain.\r\nThe daily PV has fluctuated between 5 and 9 for the most part, for an average of only 7.\r\nThat might seem close but is in fact an underachievement of 30% which is substantial.\r\n\r\nOn May 30th the PV generation was only 1.9kwh\r\n\r\n\r\nI have attached an excel examination of this month to date, plus a picture showing the kind of day we had and a screenshot showing that at 1.46pm we had only generated 7.6kwh.\r\n\r\nCan you please provide evidence of the two strings daily generation for June?\r\nI am concerned that there is something not right when a perfectly clear sunny day cannot exceed the projected average for the month.', 'low', 'resolved', 0, 0, 2, '2024-06-19 23:09:58', '2024-08-05 01:02:54'),
	(149, '0624149', 1, 7478, 'R6S3103J2336E27012', 'System Issues', 'The inverter is at it again.  \r\n\r\nIs their any way to get it replaced please.  I can safely say I\'ve lost over $50 to $100 worth of solar generation due to either the inverter or solar panels.  I understand that its been checked but I\'m paying for a faulty system. \r\n\r\nApologies for the consistent emails, but I\'ve had previous systems through solar link so I\'m putting my trust in it too please get this rectified.', 'low', 'in_progress', 0, 0, 2, '2024-06-20 23:10:11', '2024-08-12 09:00:08'),
	(150, '0624150', 1, 3303, NULL, 'Installation Issue', 'The client called to report that, five years after the installation, the old inverter was not functioning because the battery we installed was not communicating with it. To find out the precise state of their system and the contents we installed, more information is required.', 'low', 'resolved', 0, 0, 2, '2024-06-24 01:38:08', '2024-07-30 02:19:11'),
	(151, '0624151', 1, 5577, NULL, 'System Issues', 'After performing some repairs on his home, the client reported that the battery no longer functions.\r\n\r\nThough they do not blame us, the client needs help to get the system back up and running.\r\n\r\nWe just need information so we can figure out what to do next to get it fixed.', 'low', 'in_progress', 0, 0, 2, '2024-06-24 02:24:28', '2024-07-09 00:22:20'),
	(152, '0624152', 1, 7556, '4121A00253B8', 'Microinverters Undervoltage', 'The system was newly installed but the microinverters are undervoltage.\r\n\r\nBased on the error, the microinverter is not getting any voltage from the AC.', 'low', 'resolved', 0, 0, 2, '2024-06-25 05:42:10', '2024-07-05 00:02:07'),
	(153, '0624153', 1, 7356, NULL, 'Production Query', 'Client: Since having my solar panels connected, I have not noticed a huge reduction in my power bills, the reduction for Jan & Feb was approx. 40%, March was 20%, April was 18% and now my May usage is 4% more than last year, and also a jump of 374kw in 1 month.\r\n\r\n \r\n\r\nI have had a Power Pal Electricity Usage monitor installed today, and I checked them both at the same time, the Solis App said I was generating power and supplying 2.868kw to the grid, the Powerpal App noted I was using 6.1kw.\r\n\r\nThe Solis app also noted the load was .992kw.\r\n\r\n \r\n\r\nI have attached the screen shots of the 2 Apps for your information, and also a spreadsheet comparing power consumption from last year compared to this year.\r\n\r\nIs there a way that I can check if the solar panel inverter is working correctly?', 'low', 'resolved', 0, 0, 2, '2024-06-25 22:51:08', '2024-08-01 03:00:48'),
	(154, '0624154', 1, 6302, 'AL2002221120573', 'Other Device Fault', 'Alpha created a ticket for this fault. No sure yet if the client reported it or they just created a ticket for it.', 'low', 'resolved', 0, 0, 2, '2024-06-25 23:36:48', '2024-08-01 03:01:44'),
	(155, '0624155', 1, 7591, 'P0CG8020262D061', 'System Issues', 'Since the system came online yesterday, it\'s only registering/showing generation to go straight into the grid, even though we have load in the house. It\'s registering load from the house as nil and pushing all generation to the grid. I\'m not sure if this is a config issue/display issue or something else?', 'low', 'resolved', 0, 0, 2, '2024-06-27 01:54:35', '2024-07-09 00:34:11'),
	(156, '0624156', 1, 7592, 'ALA001021090534', 'System Issues', 'Inspector was in today and I note the invoice has come through, so I will start getting that paid as per arrangement starting next week.\r\n\r\n \r\n\r\nThe inspector also agreed with me that the system should not be using any grid when batteries have plenty in them, and could not understand this morning when at times even with solar working, batteries at near 50%, the app still showed large fluctuations from the grid (it went from a few watts to many kilowatts) and has taken images of the app to get someone to look into it.\r\n\r\n\r\nYour tech mob tried to say it was normal when it adjusts for loads in the usage, BUT when no solar is being produced (ie at night, etc) there is no grid use at all regardless of load variations, it is only when solar is producing (or supposed to be as he could not also work out with sunny conditions, the solar went from producing several kilowatts to zero for a few minutes then back up to normal  something I told the techs about but they dismiss as they say no faults until it shows nothing for an hour or more. Bit late then !!)\r\n \r\n\r\nWe now seem to be consuming around 2kw per day from the grid, regardless of battery capacity or solar production (as shown on our app and in the electricity providers usage in our account online), this is something that the inspector also said should not happen as we should be 100% solar/battery unless the batteries fall below the Discharge cut off SOC which is currently set 10%.\r\n\r\nCan you get someone to look into this please, rather than like the techs and just brush it off, as we have spent a lot with your company and would expect good follow up service. I agree with the inspector, that unless the battery drops below the SOC of 10%, we should not consume any grid power (especially since we never have large loads over 5kw.).', 'low', 'in_progress', 0, 0, 2, '2024-06-27 05:10:07', '2024-07-09 01:08:31'),
	(157, '0724157', 1, 7432, 'H2S3802J2338E05476', 'System Error', 'Lost Communication between inverter and Grid Meter , Isolation Error', 'low', 'resolved', 0, 0, 2, '2024-07-01 23:17:22', '2024-07-05 01:04:22'),
	(158, '0724158', 1, 6691, 'H2T2103J2338E05450', 'Grid Overcurrent', 'Client called to report the alarm and advised her to call the electricity provider to limit the voltage thats coming in from the streets.\r\n\r\n"\r\nThe output current at grid side exceeds inverter limits"', 'low', 'resolved', 0, 0, 2, '2024-07-05 01:22:10', '2024-07-09 01:10:35'),
	(159, '0724159', 1, 7399, 'ALD001022080312', 'PV production not detected', 'System installed doesn\'t show solar generation, even though the panels are directly connected to the inverter.  The battery is mostly not discharging, and the data is inconsistent.', 'low', 'resolved', 0, 0, 2, '2024-07-08 01:25:04', '2024-08-05 02:40:28'),
	(160, '0724160', 1, 4985, NULL, 'Battery Issue', 'Client called Hinal that there\'s an issue with the sytem but no further information.', 'low', 'resolved', 0, 0, 2, '2024-07-08 01:41:51', '2024-07-09 01:11:45'),
	(161, '0724161', 1, 461, NULL, 'Panel Broken', '"Please leave it for now.\r\n\r\nWhen you receive a follow up email from him, you can advise that that the smashed panels can only have been caused buy a severe hail storm and are not covered by warranty.\r\n\r\nThe damaged panels can be claimed under his home and contents insurance policy. He will need to contact his insurer."', 'low', 'on_hold', 0, 0, 2, '2024-07-08 03:26:26', '2024-07-09 01:12:56'),
	(162, '0724162', 1, 7348, 'ALD011123090093', 'Battery Fault', 'Battery breaker tripped and needs to be manually switched on.', 'low', 'resolved', 0, 0, 2, '2024-07-08 03:58:05', '2024-07-08 23:00:26'),
	(163, '0724163', 1, 7499, NULL, 'Dongle Issue', 'Hinal: The customer called about an issue with the Solplanet inverter dongle, which is not functioning properly.', 'low', 'resolved', 0, 0, 2, '2024-07-09 02:54:39', '2024-08-27 09:25:45'),
	(164, '0724164', 1, 7229, 'H2S3802G2328E00274', 'Lost Communication between inverter and Grid Meter', 'Client also reported that every morning around 8AM, the system causes a power interruption for an hour.', 'low', 'resolved', 0, 0, 2, '2024-07-09 06:23:52', '2024-09-03 09:41:43'),
	(165, '0724165', 1, 2270, NULL, 'Out of warranty service inspection', 'from Hinal: The customer requested a service call due to the positive cable running from the inverter to the battery being melted. Although there was no fire, a considerable amount of smoke was poured out from the area.', 'low', 'resolved', 0, 0, 2, '2024-07-11 04:04:11', '2024-07-30 05:25:54'),
	(166, '0724166', 1, 6915, 'SHA6021312022AD012', 'DSP Fault', '"There is a red light on the face of the battery on\r\nThe manual says its a DSP Fault"', 'low', 'in_progress', 0, 0, 2, '2024-07-11 05:13:50', '2024-07-11 05:17:58'),
	(167, '0724167', 1, 2439, NULL, 'Temp Over Fault', 'System is offline and possibly off.', 'low', 'resolved', 0, 0, 2, '2024-07-15 03:54:36', '2024-07-30 05:22:10'),
	(168, '0724168', 1, 7593, NULL, 'Battery Settings', 'Client is saying that he is exporting even the battery is not charged. He wants to charge the battery first before exporting.', 'low', 'resolved', 0, 0, 2, '2024-07-15 04:38:15', '2024-07-30 03:46:37'),
	(170, '0724170', 1, 5381, 'AL7011023010365', 'System Issues', 'Possible CT Installation Issue', 'low', 'resolved', 0, 0, 2, '2024-07-15 06:49:17', '2024-07-18 02:36:25'),
	(171, '0724171', 1, 4936, '3008458536', 'No Live Data', 'System doesn\'t have any fault or error but no live data', 'low', 'resolved', 0, 0, 2, '2024-07-16 00:18:34', '2024-07-25 23:20:46'),
	(172, '0724172', 1, 7594, 'ALD001122121460 -	ALD001122120293', 'Battery Issues', 'Client reported an issue with the system.\r\n1. On 3-4 occassions the batteries have switched off and gone into fault mode (stragely at about 1730hrs each time).  There are no tripped switches / fuses on the main fuse board so I am not sure what is happening there.  This was not an issues prior to the installation (when we had a single Alpha battery). <br>  . The batteries are not charging from the generator.  When the generator runs, the batteries / inverters only draw enough power from the generator to cover the power usage in the house - they do not charge the batteries at all.  Prior to the new installation, the old battery / inverter would charge when the generator was running.\r\nThe main difference from a user perspective is that the Alpha App shows the batteries as running in grid mode and a grid reading can be seen on the app.  Prior to this installation, the Alpha app did not show a grid reading, the batteries simply charged at a higher rate and the grid reading remained at zero.  I am not a electrician but this leads me to believe the new wiring is slightly different - perhaps the generator is connected to the \'grid connection\' rather than a \'battery / generator connection\'? It certainly used to work as expected prior to the installation, and now it is not.\r\nThe main issue this causes is during overcast conditions - last week we had to run the generator all day to cover to the usage of the house in order to allow the solar to charge the batteries at a very low rate due to the cloud coverage.  This is not ideal or sustainable.', 'low', 'resolved', 0, 0, 2, '2024-07-22 00:41:48', '2024-08-19 14:40:15'),
	(173, '0724173', 1, 4995, NULL, 'Export issue', 'Client reported that they are having issue with the export.', 'low', 'in_progress', 0, 0, 2, '2024-07-22 01:17:39', '2024-07-30 03:08:49'),
	(175, '0724174', 1, 6675, 'ALA00102190563', 'System Installation Issue', 'The client reported that the system is not functioning and cannot be updated due to improper installation.', 'low', 'resolved', 0, 0, 2, '2024-07-22 03:15:04', '2024-07-30 03:45:16'),
	(176, '0724176', 1, 5968, 'AL7002222050093', 'Alpha Battery Multi Master Error', 'Client reported a fault on their system and now it\'s showing as Multi master Error.', 'low', 'resolved', 0, 0, 2, '2024-07-22 06:30:55', '2024-07-23 06:43:40'),
	(177, '0724177', 1, 7458, 'H2S3992J2338E05382', 'Export Limit issue', 'Client called reported that his system is not exporting and the production is depending on the load.', 'low', 'resolved', 0, 0, 2, '2024-07-22 23:29:30', '2024-07-29 03:55:02'),
	(178, '0724178', 1, 5340, 'AL2002221110097', 'Fault on System', 'Rob called that since the system was installed there\'s a fault showing. \r\nNo internet available. Client advised that he\'ll be back few days from now and call me to troubleshoot the system.', 'low', 'in_progress', 0, 0, 2, '2024-07-22 23:54:28', '2024-07-30 03:11:34'),
	(179, '0724179', 1, 7348, 'ALD011123090093', 'Discharging Issue', 'The system still discharing beyond the discharge limit.', 'low', 'resolved', 0, 0, 2, '2024-07-23 00:28:57', '2024-07-30 03:15:45'),
	(180, '0724180', 1, 7579, NULL, 'Sonnen Battery Usable Capacity', 'Wondering if you can please help me understand useable capacity on my recently installed Sonnen battery. I understand I should have 10kWh, but it seems to only ever discharge to around 9% (usable), which is only more like 9.3kWh. Ive had the backup threshold set to 0, but just now changed it to 5% to see what happens - just in case the system treats 0 as no setting and perhaps it defaults to 10% or something - although thats not what the apps or manual says it does.\r\n\r\nThe screen shots below were taken at 8am this morning, with the battery fully discharged overnight. These are indicative of readings I see every morning.', 'low', 'resolved', 0, 0, 2, '2024-07-23 22:55:23', '2024-08-05 03:09:27'),
	(183, '0724181', 1, 5464, NULL, 'Production Query', 'Can you please look at these images of the water that is remaining on my solar panels at 75 Marriner St Colac East and note that my generation in May was 56kwhrs & in June only 2.5 kwhrs? Are you able to inspect and advise what is going on?', 'low', 'in_progress', 0, 0, 2, '2024-07-30 01:07:00', '2024-08-01 01:03:48'),
	(185, '0824184', 1, 2135, NULL, 'Discrepancy in Daily Generation: 30kW Fronius vs. 40kW Solis Unit', '"Can you please tell me why my 30kw Fronius unit generates more electricity and payback per day then the Solus 40kw unit\'', 'low', 'resolved', 0, 0, 2, '2024-08-01 02:00:29', '2024-08-27 14:21:34'),
	(186, '0824186', 1, 6712, 'ALD011123080065', 'Battery Issues', 'The battery is not charging and stop reading power generation, load and export. Currently, I am able to charge the battery to 10 percent and will update the firmware to see if that will rectify the issue', 'low', 'resolved', 0, 0, 2, '2024-08-01 03:37:20', '2024-08-01 04:02:10'),
	(187, '0824187', 1, 357, NULL, 'System Issues', 'Client reported an issue to Hinal but no information.', 'low', 'resolved', 0, 0, 2, '2024-08-05 05:19:15', '2024-08-09 08:54:02'),
	(188, '0824188', 1, 5966, 'A2210300841', 'Battery Discharge Concern', 'I would like to ask about the battery that is part of my installation. I\'ve noticed a huge drop in the amount of time it takes to go from 100% to essentially empty (5% is where it cuts off).\r\nAt around this time last year, on those days the battery would manage to reach 100%, it would take from around 6pm to anywhere between 2am and 9am, with 6am being most common.\r\nNow, a 100% charge lasts maybe 3 hours. I don\'t believe my power usage has gone up that much, and this seems a little excessive for battery degredation. Is it possible there is a configuration or firmware issue? Or some other repairable fault?', 'low', 'in_progress', 0, 0, 2, '2024-08-06 04:39:46', '2024-08-08 14:37:35'),
	(189, '0824189', 1, 6251, 'AL7011022090122', 'Production Query', 'Weve had a Solar Link 6.6 kW Battery/Solar system for will over 12 months now and from date of installation we have been reviewing performance statistics from the AlphaESS monitoring web site. We understand the Alpha ESS monitoring system daily reports are generated from our digital power meter integrated in with our system. This daily report is quite extensive displaying information about our power usage, consumption etc.\r\n\r\n \r\n\r\nFor billing period as listed we have collated daily Grid Consumption and daily Feed In amounts in kWhs from the solar monitoring system. The monitoring system differs substantially to our energy suppliers Billing kWh amounts for the SAME period.\r\n\r\n \r\n\r\nSuppliers monitoring system lists   --- Total Usage (Grid consumption) 261.62 kWh, Total Solar Generation (Feed In) 49.5 kWh for 7th July 2024 to 3rd August 2024.\r\n\r\n \r\n\r\nWhy is there such a discrepancy with power company billing amounts to power monitoring software indicated amounts?', 'low', 'in_progress', 0, 0, 2, '2024-08-07 09:50:39', '2024-08-20 09:03:06'),
	(190, '0824190', 1, 3669, NULL, 'Inverter Issue', 'Supply and Install Zeversolar 4000TLC (Oct 2024). Looks like there will be parts but no labor warranty\r\npb.matthews@bigpond.com', 'low', 'in_progress', 0, 0, 2, '2024-08-08 14:33:35', '2024-08-08 16:32:02'),
	(191, '0824191', 1, 1625, NULL, 'System Issues', 'Client reported a system error.', 'low', 'resolved', 0, 0, 2, '2024-08-08 15:54:45', '2024-08-19 15:22:58'),
	(194, '0824192', 1, 6301, '380518022C190093', 'System Remote Inspection', 'From : Adam---\r\nClient has left a message stating he doesn\'t think his system is working properly.\r\n\r\nIts probably OK and he just has a high winter electricity bill.\r\n\r\nPlease log on and take a look and communicate with him (Frank Trinchi)', 'low', 'in_progress', 0, 0, 2, '2024-08-09 10:38:36', '2024-08-09 10:53:31'),
	(200, '0824195', 1, 7601, NULL, 'LimbyEPM', 'Its maxing out at approx 50W. [LimByEPM]\r\n\r\nPlease follow up on Monday morning to have this fixed.', 'low', 'resolved', 0, 0, 2, '2024-08-12 08:57:21', '2024-08-15 12:09:16'),
	(201, '0824201', 1, 6575, NULL, 'System Issues', 'Client called that there\'s a notice on the app. I asked him to send  screenshot so that we\'ll know what\'s the steps to take to resolve the issue.', 'low', 'resolved', 0, 0, 2, '2024-08-12 09:07:09', '2024-08-19 16:57:46'),
	(202, '0824202', 1, 7432, 'H2S3802J2338E05476', 'Wifi Connection Issue', 'Morning all, getting really sick of this system just dropping out all the time. Installed wifi mesh system and have a unit about 2 metres away. See signal strength. But system will not connect even though it see it at strength....', 'low', 'resolved', 0, 0, 2, '2024-08-15 12:30:27', '2024-08-28 12:32:04'),
	(203, '0824203', 1, 7566, '001XOKF240059B', 'Battery Not Charging', 'System was inspection but inspector said battery did not charge.  CEOS will be issued once the system is confirmed working without issues.', 'low', 'in_progress', 0, 0, 2, '2024-08-16 13:06:09', '2024-08-19 11:05:44'),
	(204, '0824204', 1, 6030, 'ALA001021090820', 'System Issues', 'Client called and reported that the experience multiple power interruptions. Upon checking there\'s alot of errors in the system logs.', 'low', 'resolved', 0, 0, 2, '2024-08-16 16:37:52', '2024-08-19 16:56:07'),
	(205, '0824205', 1, 4974, NULL, 'System Issues [ 24004311 ]', 'The manufacturer is communicating directly with the client and I asked them to keep us posted on the progress of the issue.', 'low', 'in_progress', 0, 0, 2, '2024-08-19 11:18:06', '2024-08-19 16:56:46'),
	(206, '0824206', 1, 5993, '9010KPSC21CW0028', 'System Limited Generation', 'The clients inverter is working but the problem is it\'s being limited to 5kW, which this issue occurred way back and recurred again. GE sent a replacement homekit and hopefully this will rectify the issue. I already spoken with SAJ and he said he\'s happy to go back there and perform a test.', 'low', 'in_progress', 0, 0, 2, '2024-08-19 14:11:16', '2024-08-19 16:56:38'),
	(207, '0824207', 1, 5274, '3802010223050130', 'Inverter Dongle Port Issue', 'Dongle Issue- G007013 --\r\n\r\nDongle port possible broken by Solis contractor. Solis will arrange a replacement for the inverter with 4G model.', 'low', 'resolved', 0, 0, 2, '2024-08-20 10:09:29', '2024-08-28 11:41:42'),
	(208, '0824208', 1, 6261, 'AL7002222041168', 'High Consumption', 'System has high consumption since 13th August.  Alpha is doing a firmware update and see if it fixes the issue. Alpha also wants to know if there was a switchboard change/update on the clients side.', 'low', 'in_progress', 0, 0, 2, '2024-08-21 10:12:25', '2024-08-21 10:23:21'),
	(209, '0824209', 1, 7499, 'AP800001822C0051', 'Dongle Connection Issue', 'Client advised that the dongle disconnects randomly. Client noted that they installed a mesh, and the signal based on his screenshot was 20% to 80%', 'low', 'in_progress', 0, 0, 2, '2024-08-21 10:35:49', '2024-08-21 10:35:57'),
	(210, '0824210', 1, 7461, NULL, 'Inverter Overheating', 'The client reported that the inverter is overheating and he\'s having trouble reading the screen.', 'low', 'resolved', 0, 0, 2, '2024-08-21 16:08:50', '2024-08-23 08:49:14'),
	(211, '0824211', 1, 6224, NULL, 'System Fault', 'I am wondering about the light for fault light  on my solar system.\r\n\r\nWhat does this mean? Its been on for at least 6 months with no change.\r\n\r\nCan someone please contact me asap with a resolution.', 'low', 'in_progress', 0, 0, 2, '2024-08-23 10:27:36', '2024-08-30 10:28:04'),
	(212, '0824212', 1, 7602, 'AP001001822C0106', 'System Issues', 'Client reported that he needs to reset the system for it to work, he is communicating with Solplanet directly and solplanet have performa firmware update and advise it should fix the issue. As of 27/08 the client confirms that it\'s working though he is concerned about ehe overvoltage settings.', 'low', 'in_progress', 0, 0, 2, '2024-08-27 10:00:02', '2024-08-28 11:42:42'),
	(213, '0824213', 1, 2599, '38110B0238200007', 'Production Data Request', 'Client wanted a report from his Fronius and Solis, but I noticed that the Production and consumption appears to be moving the same or identical.', 'low', 'in_progress', 0, 0, 2, '2024-08-27 10:41:47', '2024-08-28 11:20:22'),
	(214, '0824214', 1, 7603, '741AE159-C8', 'Site Access Issue', 'Clients account was set to show the "layout" but it wasn\'t showing even after updating the access.', 'low', 'in_progress', 0, 0, 2, '2024-08-27 14:47:22', '2024-08-27 14:47:28'),
	(215, '0824215', 1, 7604, 'H2S2502J2345E06559', 'Back up circuit dropped out again', 'We had another 30 second drop out of the backup circuits again (at  8:09 PM Friday 23rd Aug)\r\n\r\nBasically the lighting and Fridge circuits dropped out for about 30 seconds and then automatically re-connected. I did not need to intervene in any way. The rest of the circuits did not loose power and there were no circuit breaker trips. \r\n\r\nOf course, these are the very circuits that should never drop out due to the UPS so something is amiss and it seems to be random. It seems not to be recorded anywhere. \r\n\r\nSo that his now 3 times:-\r\n9/8-7pm ; 12/8-11:23am and 23/8 8:09 pm.\r\n\r\nIs it possible that the protected circuits can be turned off by the inverter? (A glitch or something.)', 'low', 'in_progress', 0, 0, 2, '2024-08-28 09:27:06', '2024-08-28 09:27:25'),
	(216, '0924216', 1, 6308, NULL, 'Solis Inverter Isn\'t Showing Any Sign Of Life', 'A new one for Monday morning. I lost hot water for the last 24H and on checking the setup the battery looks all good but the Solis inverter isnt showing any sign of life at all. All switchboard CCT breakers are on and the battery app seems to show normal/good performance. The set up pre battery was that the hot water was fed by the solar inverter via a timer.', 'low', 'open', 0, 0, 2, '2024-09-02 09:22:17', '2024-09-02 09:22:17'),
	(217, '0924217', 1, 7318, NULL, 'Generator Not Working', 'Client called that the generator is not providing power to his house.', 'low', 'in_progress', 0, 0, 2, '2024-09-02 09:54:01', '2024-09-03 09:41:59'),
	(218, '0924218', 1, 7001, NULL, 'System Issues', 'The client called and reported that the system that was installed is not providing power to his house, and he said the electricity bill hasn\'t gone down.', 'low', 'open', 0, 0, 2, '2024-09-03 09:12:17', '2024-09-03 09:12:17'),
